import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';

import { ScrollingProvider, useScrollSection, Section } from 'react-scroll-section';


function NavigationBar() {
	const servicesSection = useScrollSection('services');
	const examplesSection = useScrollSection('examples');

  return (
	<Navbar expand="sm">
	  <Container>
		<Navbar.Toggle aria-controls="basic-navbar-nav" />
		<Navbar.Collapse id="basic-navbar-nav" className="justify-content-md-center">
		  <Nav>
			<Nav.Link onClick={servicesSection.onClick} selected={servicesSection.selected}>Services</Nav.Link>
			<Nav.Link href="#Examples">Examples</Nav.Link>
			<Nav.Link href="#About">About</Nav.Link>
			<Nav.Link href="#About">Contact</Nav.Link>
		  </Nav>
		</Navbar.Collapse>
	  </Container>
	</Navbar>
  );
}

export default NavigationBar;
